import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap-icons/font/bootstrap-icons.css";
import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";
import Home from "./Home";
const Navbar = () => {
  return (
    <>
    <nav className="navbar navbar-expand-lg bg-white shadow-sm">
      <div className="container">
        {/* Brand Logo */}
        <a className="navbar-brand fw-bold" href="#">
          <img src="https://res.cloudinary.com/urbanclap/image/upload/t_high_res_category/w_108,dpr_2,fl_progressive:steep,q_auto:low,f_auto,c_limit/images/growth/home-screen/1687285683825-e6cf23.jpeg" alt="Logo" height="40" /> 
        </a>
 {/* Blogs Link */}
      <Link to="/frontblog" className="nav-link fw-bold ms-3">Blogs</Link>
      {/* Category Link */}
      <Link to="/" className="nav-link fw-bold ms-3">Category</Link>
        {/* Toggle Button for Mobile */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Navbar Links */}
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav mx-auto">
            {/* Location Selector */}
            <li className="nav-item dropdown">
              <a
                className="nav-link dropdown-toggle"
                href="#"
                id="locationDropdown"
                role="button"
                data-bs-toggle="dropdown"
              >
                <i className="bi bi-geo-alt"></i> Chandigarh, India
              </a>
              <ul className="dropdown-menu">
                <li><a className="dropdown-item" href="#">Delhi</a></li>
                <li><a className="dropdown-item" href="#">Mumbai</a></li>
                <li><a className="dropdown-item" href="#">Bangalore</a></li>
              </ul>
            </li>

            {/* Search Bar */}
            <li className="nav-item">
              <form className="d-flex">
                <input className="form-control me-2" type="search" placeholder="Search for 'Facial'" />
                <button className="btn btn-outline-secondary" type="submit">Search</button>
              </form>
            </li>
          </ul>

          {/* Right-side Icons */}
          <div className="d-flex">
            <a href="#" className="me-3" style={{color:"black"}}><i className="bi bi-cart3"></i></a>
            <Link to="/SignUp" style={{color:"black"}}><i className=" ms-3 bi bi-person-circle"></i></Link>
          </div>
        </div>
      </div>
    </nav>
    <Outlet></Outlet>
    </>
  );
};

export default Navbar;
